import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { Provider } from 'react-redux'
import { createStore, applyMiddleware } from 'redux'
import thunk from 'redux-thunk'
import manageQaProject from './reducers/manageQaProject'
import manageProjectsMasterList from './reducers/manageProjectsMasterList'
import manageFindingVideos from './reducers/manageFindingVideos'
import { combineReducers } from 'redux';

const rootReducer = combineReducers({
  projectsMaster: manageProjectsMasterList,
  qaProject: manageQaProject,
  findingVideos: manageFindingVideos
})

let store = createStore(rootReducer, applyMiddleware(thunk))

ReactDOM.render(
  <Provider store = {store}>
    <App />
  </Provider>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
